import React from 'react';


function GenreCard() {
    return (
        <>
            <div class="row bg-primary text-start p-5 m-5 rounded-5">
                <h1>Pop</h1>
                <div class= "col-lg-4 d-flex flex-column">



                    <h1>Top Songs</h1>
                    <span>Song 1</span>
                    <span>Song 2</span>
                    <span>Song 2</span>
                </div>

                <div class= "col-lg-4 d-flex flex-column">



                    <h1>Popular Artists</h1>
                    <span>Song 1</span>
                    <span>Song 2</span>
                    <span>Song 2</span>
                </div>









            </div>


        </>

    );
}

export default GenreCard;
